import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p className="myLounge-heading">
          myLounge
        </p>
        <p className="myLounge-subtitle">
          Listen. Watch. Relax.
        </p>
        <SearchBar>
          name"searchbar-menu",
          inputname="searchinput-menu",
          imagename="searchbutton-menu",
          placeholdertext=""
        </SearchBar>
      </header>
      <body className="App-media-options">
        <div className="filters-header">
          <SearchBar name="searchbar" inputname="searchinput" imagename="searchbutton"/>
        </div>
      </body>
    </div>
  );
}

export default App;

function SearchBar (props) {
  return (
      <div className = {props.name}>
          <img src="https://img.icons8.com/android/24/000000/search.png" className={props.imagename} alt="searchIcon"></img>
          <input className={props.inputname} type="text" placeholder="Search Movies, TV Shows by name..."></input>
      </div>
  );
}
